import React from 'react';

const Registration = () => {
    return (
        <div className="w-[330px] h-fit  bg-gray-700 opacity-50 flex-col justify-start items-center gap-[15px] inline-flex p-2 rounded-[17px]">
            <div
                className="w-[325px] h-[50px] px-5 py-4 rounded-[10px] border border-neutral-200 justify-center items-center inline-flex">
                <div
                    className="w-[285px] text-neutral-200 text-[13px] font-normal font-['ABeeZee'] leading-[18px]">Логин
                </div>
            </div>
            <div
                className="w-[325px] h-[50px] px-5 py-4 rounded-[10px] border border-neutral-200 justify-center items-center inline-flex">
                <div
                    className="w-[285px] text-neutral-200 text-[13px] font-normal font-['ABeeZee'] leading-[18px]">Пароль
                </div>
            </div>
            <div
                className="w-[236px] h-[53px] px-[26px] py-[5px] bg-black rounded-[30px] border border-white justify-center items-center gap-2.5 inline-flex">
                <div className="text-center text-white text-xl font-normal font-['Roboto']">Войти</div>
            </div>
        </div>
    );
};

export default Registration;
